function useForm(){
  const [isSubmit,setSubmit]= useState(null);
  const [form, setForm] = useState([]);
  console.log(isSubmit.target[0].validate);
  if (isSubmit) isSubmit.preventDefault();
  return { setSubmit, setForm };
}

export default useForm;
